  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Leopold
  Wetland Management District summarizes refuge activities during fiscal year 2005.
  \ The report begins with an introduction to the refuge and a summary of the yearu2019s
  highlights and climatic conditions.  Information about monitoring and studies- including
  orchids and grassland birds - is provided next.  Habitat restoration and management
  projects are also covered; activities include wetland and upland restoration, water
  level management, moist soil management, prescribed burning, and invasive plant
  control.  Fish and wildlife management is discussed next with emphasis on bird banding
  and predator control. Coordination activities, such as agency partnerships and private
  land activities are outlined.  The resource protection section provides information
  about law enforcement and land acquisition.  Information about public education
  and recreation is given including visitor services and outreach programs.  Finally,
  refuge planning and administration are discussed.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
